import React from 'react';
import { TextField } from '@mui/material';

export default function Search() {
    return (
        <div>
            <h1>
            <TextField fullWidth  variant="standard" label="email ,ID 또는 할 일 검색" sx={{ boxShadow: 'none'}} /> 
            </h1>
        </div>
    )
}
